// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract PaymentSplitter {
    event PayeeAdded(address account);
    event PaymentReleased(address to, uint256 amount);
    event PaymentReceived(address from, uint256 amount);

    uint256 private _totalShares;
    uint256 private _totalReleased;

    mapping(address => uint256) private _shares;
    mapping(address => uint256) private _released;
    address[] private _payees;
    address public owner;

    using SafeMath for uint256;

    constructor()  {
        owner = msg.sender;
    }

    receive() external payable virtual {
        emit PaymentReceived(msg.sender, msg.value);
    }
    
    function distribute() public payable {
        
        uint256 totalamount =  address(this).balance;
        
        // pay owner
        uint256 ownersCut =  totalamount.mul(80).div(100) ;     
        bool sentOwner = payable(owner).send(ownersCut);
        require(sentOwner, "Failed to send Ether");
        emit PaymentReleased(owner, ownersCut);
        
        // pay all payees
        uint remaing = totalamount.sub(ownersCut);
        uint remaingForEach = remaing.div(_payees.length);
              
        for (uint256 i = 0; i < _payees.length; i++) {
            bool sentPayee = payable(_payees[i]).send(remaingForEach);
            require(sentPayee, "Failed to send Ether");
            emit PaymentReleased(_payees[i], remaingForEach);
          }
        
    }

    function totalAmountAvailable() public view returns(uint256) {
    return  address(this).balance;
        
    }
  

    function allPayees() public view returns (address[] memory){
        return _payees;
    }


    function _addPayee(address account) public {
        _payees.push(account);
        emit PayeeAdded(account);
    }
    
    function sendEthers() public payable {
        bool sent = payable(address(this)).send(msg.value);
        require(sent, "Failed to send Ether");
    }
}



library SafeMath {

  function mul(uint256 a, uint256 b) internal pure returns (uint256) {
    if (a == 0) {
      return 0;
    }

    uint256 c = a * b;
    require(c / a == b);

    return c;
  }

  function div(uint256 a, uint256 b) internal pure returns (uint256) {
    require(b > 0); // Solidity only automatically asserts when dividing by 0
    uint256 c = a / b;
    // assert(a == b * c + a % b); // There is no case in which this doesn't hold

    return c;
  }

  function sub(uint256 a, uint256 b) internal pure returns (uint256) {
    require(b <= a);
    uint256 c = a - b;

    return c;
  }

  function add(uint256 a, uint256 b) internal pure returns (uint256) {
    uint256 c = a + b;
    require(c >= a);

    return c;
  }

  function mod(uint256 a, uint256 b) internal pure returns (uint256) {
    require(b != 0);
    return a % b;
  }
}
